                          <option  onClick={clickHandler}>People</option>
                      </select>
                  </form>
                  <React.Fragment>
                     
                      <form className="sort">
                          <select name="order" id="sort-type" multiple>
                              <option onClick={clickOrderHandle}>Last</option>
                              <option onClick={clickOrderHandle}>Recent</option>
